          alignItems="center"
          gap={3}
          sx={{
            py: 3,
            px: 2,
            mt: 'auto',
           }
        }
        >
            <Box
      height={200}
    width='100%'
      my={4}
      display="flex"
      justifyContent="center"
      alignItems="center"
      gap={4}
      p={2}
      sx={{ width: '100%' }}
    >
    
            <Card sx={{ maxWidth: 345 }} elevation={0}><CardMedia component="img" image={image}
   
 />
 </Card></Box>
          <Container maxWidth="sm">

            <Typography variant="body1">
              
            </Typography>
            <Copyright />
          </Container>
        </Box></>;
}
